import React from "react";
import Header from "./Header";

const App = () => {
  const part1 = "Fundementals of React";
  const exercise1 = 10;
  const part2 = "Using props to pass data";
  const exercise2 = 7;
  const part3 = "State of a component";
  const exercise3 = 14;

  return (
    <div>
      <Header />
      <p>
        {part1} {exercise1}
      </p>
      <p>
        {part2} {exercise2}
      </p>
      <p>
        {part3} {exercise3}
      </p>
      <p>Number of exercises {exercise1 + exercise2 + exercise3}</p>
    </div>
  );
};

export default App;
